s.m(0,"garden",new A.dR("Gomiland Community garden\n\nPlants here are grown with sunlight, love and of course, organic fertilizers.\nOur crops grown here are served at cafes around the town.\nCommunity gardens reduce transport costs of ingredients and promotes sustainable living\nGet involved today by collecting food scraps to make compost!\n\nFounded by Mr Moon and Mr Sun.\n"))
s.m(0,"cafe",new A.dR("Enjoyeux cafe\n\nBest vegan food in town!\n\nChoosing plant-based proteins like beans, lentils, and tofu shrinks your carbon footprint.\n\nIt conserves precious water and protects biodiversity.\n\nGo green, go meatless, and savor the positive impact on our planet, one delicious bite at a time\n\nGreenhouse Gases: Animal agriculture is responsible for 14.5% of global greenhouse gas emissions\nLivestock production uses 70% of all agricultural land globally, yet only provides 18% of the world's calories. Choosing plant-based foods frees up land for other uses, like restoring natural ecosystems\n\nSource: https://www.reuters.com/business/environment/ factbox-how-food-agriculture-contribute-climate-change-2023-12-02/"))
