s.m(0,"park_sign",new A.dR("This way to Gomiland National Park.\n\nDon't forget to visit the Castle, Bamboo Forest Shrine, World forest and the Honey Bee Colony\n\nPlease pick up rubbish in the park. Let's do our part to keep the park clean!\n\nImportance of National Parks:\n1. Protect ecological biodiversity, preserve landscapes\n2. Provide economic support for natural and cultural resources through tourism\n3. Protection from threats including logging and land clearing, pollution, and urban development\n4. Provide a safe haven for threatened native species\n\nSource: https://blog.nationalparks.nsw.gov.au/whats-a-national-park-and-why-does-it-matter,\nhttps://www.nathab.com/blog/why-national-parks-matter,"))
s.m(0,"school",new A.dR("Gomiland Elementary School\n\nWhere young minds flourish"))
s.m(0,"zen_garden",new A.dR("Zen garden\n\nStay and enjoy the tranquility of the garden"))
