s.m(0,"hood_sign",new A.dR("Gomiland Neighbourhood\nBustling energy meets friendly charm\n\nGomiland achieves sustainability through:\n1. Green public spaces\n2. Water and energy conservation\n3. Walking and bike friendly roads\n4. Eco-friendly buildings\n5. Waste management system (new)"))
s.m(0,"park_centre",new A.dR("Gomiland National Park\nHome to many different species of plants and wildlife.\n\nImportance of National Parks:\n1. Protect ecological biodiversity, preserve landscapes\n2. Provide economic support for natural and cultural resources through tourism\n"))
