s.m(0,"sakuras",new A.dR("Cherry Blossoms\n\nDue to climate change, Cherry Blossom blooms are happening earlier each year.\nThis puts them at risk of cold snaps.\n\nBecause of warming climate, flowers may bloom before insects are ready and vice versa.\nThis means there may not be enough food for the insects or plants.\n\nLet's do our part to protect the environment today!\n\nSource: https://www.washingtonpost.com/weather/2023/03/18/ cherry-blossoms-climate-change-washington,\nhttps://edition.cnn.com/travel/article/ climate-crisis-cherry-blossom-kyoto-japan-intl-hnk-scn"))
s.m(0,"bee_colony",new A.dR("Honey Bee colony\n\nBest honey in Gomiland! Look for Manuka to find out how to get your honey!\n\nHoney bees perform majority of pollination for our food crops\nHowever their global population is in decline which is a threat to our food security\nImage a world where you can't get tasty honey!\nFound out how you can do your part to save the bees at https://thebeeconservancy.org/10-ways-to-save-the-bees/\n\nSource: https://e360.yale.edu/features/ declining_bee_populations_pose_a_threat_to_global_agriculture,\nhttps://www.clemson.edu/extension/ pollinators/apiculture/importance.html"))
